import React from 'react';

import './indicators-list.styles.css';

const IndicatorsList = ( { displayedIndicators }) => {
    return (
        <ul className="indicators-list">
            {displayedIndicators.map((item,index) => {
                console.log(item.selected,'item.selected',item.selected ? 'selected' : '')
                return (
                    <li 
                        key={item.id}
                        id={item.id}
                        onClick={(e) => console.log('cl',e.target.id)}
                        className={item.selected ? 'selected' : ''}
                    >
                        {item.name}
                    </li>
                )
            })}

        </ul>
    )
}

export default IndicatorsList;
